    "library(ggplot2)\n",
    "library(tidyverse)\n",
    "library(dplyr)\n",
    "\n",
    "\n",
    "#We start by loading in our initial data, and the removing any unnecessary collumns of data we will not need\n",
    "skills_job_data <- read_csv(\"/kaggle/input/data-science-job-posting-on-glassdoor/Cleaned_DS_Jobs.csv\")\n",
    "colnames(skills_job_data)\n",
    "\n",
    "clean_skills_job_data <- skills_job_data %>%\n",
    "  select(-one_of(\"Company Name\",\"same_state\",\"Type of ownership\",\"min_salary\", \"same_state\", \"Salary Estimate\",\"Location\", \"max_salary\",\"company_age\",\"Job Description\", \"Headquarters\",\"avg_salary\",\"Rating\",\"Size\",\"Revenue\",\"job_state\",\"seniority\"))\n",
    "head(clean_skills_job_data)\n",
    "\n",
    "#We rwite out this cleaned data to a new csv file\n",
    "write.csv(clean_skills_job_data, \"clean_skills_job_data.csv\")"
   ]
  },
