   "source": [
    "Here we can see a tible showcasing the necesarry sections of data we will use to perform our analysis.\n",
    "\n",
    "However the data isn't completely usable. The various technologies; python, excel, hadoop, spark, aws, and tableau are represented to be used in certain jobs as 1 and 0, with 1 meaning that it is used and 0 menaing that it isn't. In order to make it easier to count and visualize our data later on, this sheet is then exported as a new csv and the cells for each technology are replaced with their names instead of the binary values.\n",
    "\n",
    "Ex: In the collumn for python all the 1s are replaced with \"python\" and the 0s are left as blank spots.\n",
    "\n",
    "The section \"job_simp\" is also renamed to \"job type\" for ease of understanding."
   ]
